import React from 'react';
import './App.css';
import Logo from './components/MenuSuperior/Logo'
import MenuSuperior from './components/MenuSuperior/MenuSuperior';

function App() {
  return (
    <div className="App">
      <MenuSuperior></MenuSuperior>
      <Logo></Logo>
    </div>
  );
}

export default App;
